window.bookSummaryJSON = "<p><b>Enter the explosive world of the blockbuster Shatter Me series by #1 </b><b><i>New York Times</i></b><b> bestselling author Tahereh Mafi!</b></p> <p>This audio bundle includes the first three books in the captivating series:</p> <p><b>SHATTER ME</b>: A girl with the ability to kill with a single touch is held hostage as an evil regime called the Reestablishment tries to use her as a weapon.</p> <p><b>UNRAVEL ME</b>: Juliette is free from the Reestablishment’s clutches, but is relentlessly pursued by one of its leaders, Warner, who’s immune to her deadly touch.</p> <p><b>IGNITE ME</b>: To take down the Reestablishment once and for all, Juliette must decide whether she can risk trusting Warner—and whether she wants to trust him with more than just their mission.</p>"; 
